Reports cases when not all abstract properties or methods are defined in
a subclass.

**Example:**

```
from abc import abstractmethod, ABC


class Figure(ABC):

    @abstractmethod
    def do_figure(self):
        pass


class Triangle(Figure):
    def do_triangle(self):
        pass
```

When the quick-fix is applied, the IDE implements an abstract method for the `Triangle` class:

```
from abc import abstractmethod, ABC


class Figure(ABC):

    @abstractmethod
    def do_figure(self):
        pass


class Triangle(Figure):
    def do_figure(self):
        pass

    def do_triangle(self):
        pass
```

